export const styles = theme => ({
    root: {
        background: theme.palette.white.main,
        display: "flex",
        flexDirection: "column",
        overflow: "hidden",
        padding: 0,
        transition: "max-height ease-in-out .5s",
        width: "100%",
        zIndex: theme.level.modal,
        [theme.breakpoints.between("md", "xl")]: {
            borderRadius: "8px",
            maxHeight: "450px",
            top: "9px",
            position: "absolute",
        },
        [theme.breakpoints.between("xs", "md")]: {
            borderRadius: 0,
            bottom: 0,
            left: 0,
            height: "100%",
            overflow: "auto",
            position: "fixed",
            right: 0,
            top: 0,
        },
    },
    rootPkg: {
        [theme.breakpoints.between("md", "xl")]: {
            width: "412px",
        },
    },
    closed: { maxHeight: 0 },
    boxResult: {
        borderTop: `1px solid ${theme.palette.grey[50]}`,
        padding: `0 0 ${theme.spacing(2)}px`,
    },
    input: { fontSize: "16px" },
    inputPkg: {
        fontSize: "14px",
        padding: `${theme.spacing(3) + 4}px ${theme.spacing(2)}px 2px 0px`,
    },
    inputPkgRight: {
        fontSize: "14px",
        padding: `${theme.spacing(3) + 4}px ${theme.spacing(2)}px 2px 0px`,
        textAlign: "right",
    },
    inputLabel: {
        lineHeight: "18px",
        marginTop: "14px",
    },
    inputLabelRight: {
        fontSize: "14px",
        lineHeight: "18px",
        marginTop: "14px",
        right: `${theme.spacing(4)}px`,
        left: "unset",
    },
    list: {
        margin: 0,
        padding: 0,
    },
    listItem: {
        listStyle: "none",
        paddingTop: `${theme.spacing(0.5) + 2}px`,
        paddingBottom: `${theme.spacing(0.5) + 2}px`,
        cursor: "pointer",
    },
    listItemTitle: {
        color: theme.palette.text.secondary,
        padding: `${theme.spacing(2)}px`,
    },
    name: {
        color: theme.palette.text.primary,
        marginRight: theme.spacing(0.5),
        verticalAlign: "middle",
    },
    adressHotel: { verticalAlign: "middle" },
    adress: { display: "block", color: theme.palette.text.secondary },
    date: { verticalAlign: "middle" },
    content: {
        display: "inline-block",
        marginLeft: theme.spacing(1),
        overflow: "hidden",
        textOverflow: "ellipsis",
        verticalAlign: "middle",
        width: `calc(100% - ${theme.spacing(3.5)}px)`,
        whiteSpace: "nowrap",
    },
    flexGrow: {
        flexGrow: 1,
        paddingLeft: theme.spacing(1),
        lineHeight: `${theme.spacing(3.5)}px`,
        fontSize: "16px",
    },
    container: { position: "relative" },
    internalInput: {
        alignItems: "center",
        display: "flex",
        height: "56px",
        padding: `${theme.spacing(1) + 2}px ${theme.spacing(2) - 4}px`,
        boxSizing: "border-box",
    },
    flex: { display: "flex" },
    scrolling: { overflowY: "auto" },
    heightLimit: { maxHeight: "176px" },
    origin: { position: "relative" },
    iconAH: {
        background: theme.palette.primary.main,
        borderRadius: "100%",
        color: theme.palette.white.main,
        left: "50%",
        position: "absolute",
        top: "35px",
        transform: "translate(-50%, -50%)",
        zIndex: theme.level.content,
    },
    originField: {
        paddingRight: theme.spacing(0.5),
        position: "relative",
    },
    destinyField: {
        paddingLeft: theme.spacing(0.5),
        position: "relative",
    },
    labelIata: {
        top: "15px",
        left: "16px",
        position: "absolute",
        lineHeight: "26px",
        color: theme.palette.white.main,
        letterSpacing: "0.01em",
    },
    labelIataRight: {
        top: "15px",
        right: "16px",
        position: "absolute",
        lineHeight: "26px",
        color: theme.palette.white.main,
        letterSpacing: "0.01em",
    },
    labelWhite: { color: theme.palette.white.main },
    sublistItem: { paddingLeft: theme.spacing(5) },
    originInput: { "& input": { padding: "20px 0 0 15px" } },
    destinyInput: {
        "& input": {
            padding: "20px 15px 0 0",
            textAlign: "right",
        },
    },
    nested: {
        paddingLeft: theme.spacing(4),
    },
});

export default styles;
